(5, 'kanopi Termurah Di Tangerang Dan JABODETABEK', '<p><font style=\"background-color: rgb(247, 247, 247);\" color=\"#ff0000\"><b>&nbsp;</b></font><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\">Kanopi untuk sekarang sebuah atap rumah yang paling di minati semua orang untuk untuk atap rumah. Kanopi Murah Di Tangerang&nbsp;</span><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\">Kanopi digunakan sebagai pelindung halaman rumah</span><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\">&nbsp;agar kendaraan dapat terhindar dari terik matahari dan air hujan. kami menawarkan jasa dan pembuatan kanopi untuk atap rumah anda,&nbsp;</span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Harga diatas include :</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">- Baja ringan 0.75mm terpasang.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">- atap solarflat 1,2 mm terpasang.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">- Garansi kebocoran selama 3 bln.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">- ukuran di bawah 20 meter kita hitung borongan/sesuai kesepakatan</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">- harga di atas sudah termasuk pengecatan</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">-- spek pemasangan harga diatas untuk modell minimalist. - untuk Tiang V tidak include harga per mÂ². dikenakan biaya tambahan untuk tiang V</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">+ noted : foto atau vidio yg kita pakai di iklan real hasil pemasangan kita ya , bukan hasil paste foto produk pemasangan orang, krna bnyak iklan yg saat mencuri hasil pemasangan orang.</span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Barang berkualitas pejabat harga merakyat..</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Tenaga pasang yang handal, terampil dan berpengalaman.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Presisi yang tinggi serta akurat.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Kokoh, kuat, dan rapih.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Anti rayap, tahan api, dan cuaca.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Cepat dan mudah dalam pemasangan</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Ramah lingkungan.</span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><br></span><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"WhatsApp_Image_2022-10-05_at_17_42_15.jpeg\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><br></span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><br></span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Ekonomis dan jaminan kualitas material</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Didukung Software TRUSS D&amp;E yang menjamin tingkat kekuatan.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">RancanganTelah bersertifikasi ITB untuk uji kelayakan tarikan Garansi 10 Th untuk konstruksi atap.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\"><br></span></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"WhatsApp_Image_2022-10-05_at_17_42_12.jpeg\"><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\"><br></span></p><p><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\"><br></span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">1. Free Biaya Survey dan Free Konsultasi.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">2. Terima pemasangan se-JABODETABEK.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">3. Pemasangan material lebih rapat standar SNI.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">4. Tidak menurunin spesifikasi material, barang datang cek kembali.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">5. Kami hanya menggunakan bahan Galvalume prime No. 1, hard tensile strength G550, yang telah memiliki sertifikat SNI.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">6. Harga yang ditawarkan bersahabat dan terjangkau, sehingga tidak menguras kantong.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">7. Harga tidak terikat. Semakin besar luasannya, kami berikan harga penawaran terbaik.</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">8. Semua biaya sudah all-in, kecuali ada permintaan khusus untuk penambahan material diluar paket atap yang sudah kami tawarkan</span><br style=\"box-sizing: inherit; color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">Pastikan atap rumah dan kanopi Anda dikerjakan oleh ahli dibidangnya..</span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">untuk informasi lebih lanjut silahkan menghubungi kami <b>082114349358</b>.</span></p><p><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\">atau klik icon whatsapp di samping kiri layar.<br></span><span style=\"color: rgba(49, 53, 59, 0.96); font-family: &quot;Open Sauce One&quot;, sans-serif; font-size: 14px;\"><br></span><span style=\"color: rgb(86, 98, 113); font-family: museo-sans; font-size: 16px;\"><br></span></p>', 'kanopi-termurah-di-tangerang-dan-jabodetabek', 'kanopi-minimalis-1668847267.jpeg', '', '2022-11-19 15:41:07', 0, '', NULL, NULL);
