(21, 'Kanopi', 'Canopy', '<b style=\"color: rgb(32, 33, 34); font-size: 14px;\">Kanopi</b><span style=\"color: rgb(32, 33, 34); font-size: 14px;\">&nbsp;adalah atap yang di buat terpisah dari atap utama sebuah bangunan dan terletak diarea luar bangunan utama itu sendiri,baik itu rumah tinggal ,perkantoran,toko,mall dan sebagainya. Kanopi berfungsi sebagai atap yang dapat menaungi atau melindungi objek atau benda di bawahnya sehingga terlindungi dari cuaca panas atau hujan. Kanopi terbagi menjadi beberapa bagian pokok,yaitu bagian rangka yang biasanya terbuat dari bahan besi,kayu,alumunium,bajaringan dan sebagainya. Bagian yang lainnya biasanya adalah atap. Kanopi terbuat dari bahan-bahan yang jelas lebih ringan di banding atap bangunan utama, seperti contohnya polycarbonate,metal plat zhincalum,kaca tempereed,kain khusus kanopi dan alumunium composite. Kanopi terbagi menjadi beberapa jenis yaitu kanopi standart,biasa untuk carport dan lahan parkir,kanopi gongsol untuk menaungi pintu atau jendela,kanopi setengah konstruksi contoh buat mall,spbu dan lain-lainnya.</span>', 'canopi-1665485352.jpeg', '2022-10-11 17:49:12', 'kanopi', '0', 1, '', 0, ''),
(22, 'Tangga', 'Tangga', '<p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: &quot;Open Sans&quot;; font-size: 15px;\">Pernah mendengar, anak kecil yang terjatuh dari tangga karena tidak ada pengamannya, atau mungkin railing yang tidak didesain dengan aman sehingga mudah dipanjat anak kecil. Kali ini akan dibahas bagian dari tangga yang berupa railing dan handrail, sebagai faktor penting untuk pengaman tangga anda.</p><p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: &quot;Open Sans&quot;; font-size: 15px;\">Railing tangga tidak hanya sekedar pembatas yang berupa tiang berjajar, tetapi lebih dari itu railing tangga harus kuat dan aman bagi siapapun penggunanya. Railing tangga akan menopang handrail, sebagai faktor penting pengaman tangga, idealnya tinggi railing berkisar antara 80 cm â 100 cm, sesuai dengan standar kenyamanan jangkauan tangan ketika orang dewasa berdiri.</p><p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: &quot;Open Sans&quot;; font-size: 15px;\">Bagi anda yang memiliki anak kecil, lebih aman bila menggunakan railing dalam bentuk vertikal dengan jarak rapat, sehingga kemungkinan untuk dipanjat dan memasukkan kepala, kecil kemungkinan bagi buah hati anda melakukannya.</p><p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: &quot;Open Sans&quot;; font-size: 15px;\">Handrail dan railing terbuat dari material yang dapat disesuaikan dengan gaya rumah anda, yang jelas tetap tidak terlepas dari konsep aman. Untuk rumah minimalis anda, bisa dipadukan antara besi hollow dan kayu, atau aluminium bahkan baja string. Untuk rumah etnik, cenderung lebih kearah dominasi kayu. Bentuknyapun bisa beragam bias bulat atau kotak asalkan memiliki sudut yang tumpul untuk faktor keamanan.</p><p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: &quot;Open Sans&quot;; font-size: 15px;\">Handrail memiliki standar ukuran kenyamanan diameter antara 4 cm â 5 cm. Mungkin rumah anda memiliki tangga yang salah satu sisinya dibatasi oleh dinding tembok, terkadang handrail diabaikan pada sisi yang berhimpitan dengan dinding dilihat dari sisi efisiensi biaya. Tetapi bila faktor pengaman tangga menjadi faktor terpenting yang menjadi prinsip rumah anda, apalagi bila ada lansia dalam rumah anda. Agar dapat mencengkram dengan baik, harus ada jarak minimal 4 cm dari tembok, sehingga tangan anda aman dari gesekan ke dinding.</p><p class=\"font_8\" style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-family: &quot;Open Sans&quot;; font-size: 15px;\">Satu lagi pemahaman anda bertambah tentang bagian dari tangga, yang mungkin terkadang anda abaikan, demi faktor penting bagi keamanan tangga rumah anda, jangan abaikan railing dan handrail untuk tangga rumah anda.</p>', 'tangga-1665486005.jpeg', '2022-10-11 18:00:05', 'tangga', '0', NULL, '', 0, ''),
(23, 'Pagar Teralis', 'Open this select menu', '<span style=\"color: rgb(48, 48, 48); font-family: Lato, sans-serif; font-size: 16px;\">Pagar dan teralis telah menjadi aksen dekorasi rumah yang banyak digunakan saat ini. Pada awalnya pagar dianggap sebagai bentuk privasi yang sangat berlebihan. Namun sekarang banyak dipengaruhi oleh faktor keamanan sehingga pagar tidak hanya penting, tapi juga wajib. Pengaruh pagar untuk rumah menjadi sangat besar terutama untuk nilai rumah di masa depan. Berikut ini beberapa manfaat lain dari penggunaan pagar rumah dengan berbagai model yang berbeda.</span>', 'pagar-tralis-1665486250.jpeg', '2022-10-11 18:04:10', 'pagar-teralis', '0', 0, '', 0, ''),
(24, 'Teralis', 'Tralis', '<p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-right: 0px; margin-bottom: 1.75em; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Inter, sans-serif; color: rgb(75, 79, 88);\">Membuat rumah aman dan nyaman merupakan hal penting yang harus diperhatikan oleh penghuni rumah. Salah satu cara menjaga keamanan rumah adalah dengan memasang teralis di berbagai elemen&nbsp;<a href=\"https://www.pinhome.id/kamus-istilah-properti/arsitektur/\" style=\"box-sizing: inherit; text-decoration: none; color: var(--ast-global-color-0); transition: all 0.2s linear 0s; font-family: Inter, sans-serif !important;\">arsitektur</a>.&nbsp;</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-right: 0px; margin-bottom: 1.75em; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Inter, sans-serif; color: rgb(75, 79, 88);\">Teralis adalah konstruksi besi berupa bingkai yang berfungsi sebagai pengaman sekaligus dekorasi pada pintu, jendela, hingga tangga. Dengan memasang teralis maka dapat menghalangi dan mempersulit maling yang ingin menerobos masuk ke dalam rumah.&nbsp;</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-right: 0px; margin-bottom: 1.75em; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Inter, sans-serif; color: rgb(75, 79, 88);\">Dalam bahasa Inggris, teralis disebut&nbsp;<em style=\"box-sizing: inherit;\">trellis&nbsp;</em>yang merujuk pada elemen pengaman pada struktur outdor. Sementara secara asal katanya, teralis berasal dari kata Latin lat Trichila yang berarti penyangga tanaman.&nbsp;</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-right: 0px; margin-bottom: 1.75em; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Inter, sans-serif; color: rgb(75, 79, 88);\">Teralis memang bukan elemen arsitektur baru karena sudah ada sejak masa Renaissance sekitar abad 15-16. Di masa itu, penggunaan terali sudah banyak digunakan oleh bangsa Mesir, Persia, Romawi, Tiongkok, hingga bangsa Skotlandia Pertengahan sebagai penghias&nbsp;<a href=\"https://www.pinhome.id/kamus-istilah-properti/taman/\" style=\"box-sizing: inherit; text-decoration: none; color: var(--ast-global-color-0); transition: all 0.2s linear 0s; font-family: Inter, sans-serif !important;\">taman&nbsp;</a>untuk memisahkan semak-semak pinggir teman dengan jalan setapak yang membelahnya.&nbsp;&nbsp;</p><p style=\"box-sizing: inherit; border: 0px; font-size: 16px; margin-right: 0px; margin-bottom: 1.75em; margin-left: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Inter, sans-serif; color: rgb(75, 79, 88);\">Hingga saat ini terali pun banyak digunakan di dalam berbagai jenis&nbsp;<a href=\"https://www.pinhome.id/kamus-istilah-properti/tipe-rumah/\" style=\"box-sizing: inherit; text-decoration: none; color: var(--ast-global-color-0); transition: all 0.2s linear 0s; font-family: Inter, sans-serif !important;\">tipe hunian</a>. Tak sekadar menambah keamanan rumah, terali pun dipakai untuk menambah estetika rumah karena memiliki bentuk dan motif yang bisa dipilih.&nbsp;</p>', 'tralis-1665486643.jpeg', '2022-10-11 18:10:43', 'teralis', '0', NULL, '', 0, '');
