INSERT INTO `set_profil` (`profil_id`, `nama`, `alamat`, `deskripsi`, `logo`, `foto`, `kontak_id`, `company_name`, `web_url`, `title`, `slogan`, `tentang`, `video`) VALUES
(1, 'Rafi Utama', 'Jalan Raya Puspitek RT 01 RW 01 Kelurahan Setu Kecamatan Setu, Tangerang Selatan, Buaran, Kec. Serpo', 'Bengkel las murah terdekat di Tangerang Selatan hasil rapih &amp; bergaransi dengan di kerjakan oleh SDM yang berpengalaman +62 821-1434-9358', '1665223903.jpeg', '1686513959.jpg', 1, 'Mutiara Las', 'https://bengkellasmutiara.com/', 'Bengkel Las murah Tangerang Selatan | Jasa Pembuatan Kanopi Dan Tralis', 'Selalu Memberi Kemudahan, Dan Solusi Untuk Anda ', '<p><b>Tentang Rafiutama</b></p><p><b><br></b></p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Lato, sans-serif; font-size: 14px; text-align: justify;\">Berawal dari sebuah perusahaan yang bergerak dibidang kontraktor penyedia jasa bangun dan renovasi rumah, kantor dan gedung yang didirikan pada tahun 2018 dengan legalitas yang lengkap. PT. Patria Karya Utama (Pakama) sekarang berkembang menjadi sebuah perusahaan yang bergerak dalam bidang penyedian jasa interior dan eksterior.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Lato, sans-serif; font-size: 14px; text-align: justify;\">Dengan menggunakan jasa kami, anda tidak perlu report&nbsp; ketika ingin mewujudkan rumah impian anda karena kami&nbsp; hampir menyediakan semua jasa yang anda perlukan dalam mewujudukan impian rumah anda.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Lato, sans-serif; font-size: 14px; text-align: justify;\">Di mulai&nbsp; jasa desain rumah gambar 3d dan gambar imb untuk rumah dan kantor, pengurusan imb untuk daerah Jakarta, Depok, Bogor ,Tangerang dan Bekasi, jasa pengeboran air,&nbsp; jasa pemasangan listrik, jasa bangun rumah baik lantai satu maupun lantai dua, jasa renovasi rumah, jasa desain fasad atau tampak depan, jasa pembuatan dan pemasangan kusen alumunium , jasa pembuatan dan pemasangan pagar, kanopi, teralis, railing tangga baik yang terbuat dari besi maupun stainless serta jasa&nbsp; pembuatan custom furniture seperti kitchen set , bedroom set dan lainnya dengan menggunakan bahan multiplek yang di lapisi hpl atau pun ACP (aluminium Composite Panel) dengan model dan desain sesuai yang anda inginkan.</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Lato, sans-serif; font-size: 14px; text-align: justify;\">PT Patria Karya Utama mempunyai workshop atau&nbsp; bengkel las serta bengkel aluminium yang berada didaerah sawangan&nbsp; Depok yang berada di pertengahan antara Jakarta Bogor, Depok dan Tangerang. serta martketing office yang berada di Depok Townsquare&nbsp;</p><p style=\"outline: 0px; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Lato, sans-serif; font-size: 14px; text-align: justify;\">Untuk mewujudkan visi dan misi perusahaan, kami didukung lebih dari 30 karyawan yang berpengalaman dan professional yang ahli dalam bidangnya yang selalu mengedepankan kualitas dan&nbsp; kecepatan serta harga yang terbaik untuk membuat seluruh pelanggan kami merasa puas.</p>', 'conto.mp4');
